import styled from 'styled-components'

export const CardStyle = styled.div`

    .card {
        width: 350px;
        height: 400px;
        background: #1E212A;
        display: flex;
        justify-content: center;
        margin-left: 100px;
    }

    .centralBorder {
        background: #00FF7F;
        width: 390px;
        height: 390px;
        margin-top: 5px;
    }


`
